import React from 'react';
import './Profile.css';
import RegisterInput from '../RegisterInput/RegisterInput';

function Profile() {
    return (
        <div className="profile">
            <h2 className="profile-title">Привет, Андрей!</h2>
            <form className="profile__form">
                <fieldset className="profile__name">
                    <RegisterInput label="Имя" name="name" placeholder="Андрей" />
                </fieldset>
                <fieldset className="profile__email">
                    <RegisterInput label="E-mail" name="email" placeholder="adm.az-an@yandex.ru" />
                </fieldset>
            </form>
        </div>
    )
}

export default Profile;
